import React from "react";

function LoginInput(props) {
    return (
        <div className="loginInput">
            <span className="inputPlaceholder">
                {props.placeholder}
            </span>
            <input
            type={props.type}
            name={props.name}
            />
            {(props.name === 'password')
            ?
            <button type="button" id="visible-password"></button>
            : null}
        </div>
    );
}

export default LoginInput;
